import React from "react";

function JumpClicker() {
  return (
    // <div id="jumper-wrapper">
    <div id="jumper">
      <a className="jumper-link link" href="#about-section">
        About
      </a>
      <a className="jumper-link link" href="#projects-section">
        Projects
      </a>
      <a className="jumper-link link" href="#education-section">
        Education
      </a>
      <a className="jumper-link link" href="#experience-section">
        Experience
      </a>
      <a className="jumper-link link" href="#skills-section">
        Skills
      </a>
      <a className="jumper-link link" href="#contact-section">
        Contact
      </a>
    </div>
    // </div>
  );
}

export default JumpClicker;
